import React, { useState } from "react";
import { createRoot } from "react-dom/client";
import TriggerDemo from "./TriggerDemo";
import MapUpload from "./components/MapUpload";  // ✅ Import MapUpload.js

const App = () => {
    const [view, setView] = useState("triggers"); // Default view

    return (
        <div style={{ textAlign: "center", padding: "20px" }}>
            <h1>ParcoRTLS Management</h1>

            {/* Toggle Buttons */}
            <div style={{ marginBottom: "20px" }}>
                <button 
                    onClick={() => setView("triggers")} 
                    style={{ marginRight: "10px", padding: "10px", fontSize: "16px" }}
                >
                    Trigger Management
                </button>
                <button 
                    onClick={() => setView("maps")} 
                    style={{ padding: "10px", fontSize: "16px" }}
                >
                    Map Upload
                </button>
            </div>

            <hr />

            {/* Conditionally Render Components */}
            {view === "triggers" ? <TriggerDemo /> : <MapUpload />}
        </div>
    );
};

const container = document.getElementById("root");
const root = createRoot(container);
root.render(<App />);
